import { ChangeDetectionStrategy, Component, ViewEncapsulation } from '@angular/core';
import { FormControl, FormGroup, Validators } from '@angular/forms';
import { MatDialogRef } from '@angular/material/dialog';

@Component({
  selector: 'app-contact-dialog',
  templateUrl: './contact-dialog.component.html',
  styleUrls: ['./contact-dialog.component.scss'],
  encapsulation: ViewEncapsulation.None,
  changeDetection: ChangeDetectionStrategy.OnPush,
})
export class ContactDialogComponent {
  contactForm = new FormGroup({
    name: new FormControl('', [
      Validators.required,
    ]),
    email: new FormControl('', [
      Validators.required,
      // eslint-disable-next-line max-len
      Validators.pattern(/^(([^<>()\[\]\\.,;:\s@"]+(\.[^<>()\[\]\\.,;:\s@"]+)*)|(".+"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/),
    ]),
    message: new FormControl('', [
      Validators.required,
      Validators.maxLength(1000),
    ]),
  });

  constructor(
    private dialogRef: MatDialogRef<ContactDialogComponent>,
  ) {
  }

  onSubmit() {
    if (this.contactForm.invalid) {
      return;
    }

    this.dialogRef.close(this.contactForm.value);
  }
}
<h2 mat-dialog-title><b>Contact Me!</b></h2>
<form class="contact-dialog" [formGroup]="contactForm" (ngSubmit)="onSubmit()" data-cy="contact-form">
  <mat-dialog-content class="mat-typography">
    <mat-form-field appearance="fill">
      <mat-label>Name</mat-label>
      <input matInput formControlName="name" />
      <mat-error>Please enter a valid name</mat-error>
    </mat-form-field>
    <mat-form-field appearance="fill">
      <mat-label>Email</mat-label>
      <input matInput formControlName="email" />
      <mat-error>Please enter a valid email</mat-error>
    </mat-form-field>
    <mat-form-field appearance="fill">
      <mat-label>Message</mat-label>
      <textarea
        rows="8"
        matInput
        cdkTextareaAutosize="false"
        formControlName="message"
      ></textarea>
      <mat-error *ngIf="contactForm.get('message')?.hasError('required')"
        >Please enter a message</mat-error
      >
      <mat-error *ngIf="contactForm.get('message')?.hasError('maxlength')"
        >Your message is too long</mat-error
      >
    </mat-form-field>
  </mat-dialog-content>
  <mat-dialog-actions align="end">
    <button mat-flat-button mat-dialog-close>Cancel</button>
    <button mat-flat-button type="submit" color="primary">Submit</button>
  </mat-dialog-actions>
</form>

