export class GetItems {
    public static readonly type = '[Cv] Get Items';

    constructor() { }
}

import { Injectable } from '@angular/core';
import { ContentfulService } from '@core/services/contentful.service';
import { forkJoin, Observable, of } from 'rxjs';
import { map, mergeMap } from 'rxjs/operators';

@Injectable({
  providedIn: 'root',
})
export class CvService {
  constructor(
    private cms: ContentfulService,
  ) {
  }

  // todo fix types
  getCv(): Observable<any> {
    return this.cms.getAllEntriesByContentType('cvList').pipe(
      map(entries => {
        const fields = entries.items.map((nested: any) => nested.fields);

        return fields;
      }),
      mergeMap((items: any[]) => {
        const itemObs: any = [];

        items.forEach(item => {
          if (item.children && item.children.length) {
            const childObs: any = [];

            item.children.forEach((child: any) => {
              childObs.push(this.cms.getEntryById(child.sys.id));
            });

            if (childObs.length) {
              itemObs.push(forkJoin(childObs).pipe(
                map((childrenRes) => {
                  const parsedChildren = childrenRes.map((childRes: any) => ({
                    name: childRes.fields.title,
                    route: childRes.fields.entryTitle,
                  }));

                  return {
                    name: item.name,
                    order: item.order,
                    children: parsedChildren,
                  };
                }),
              ));
            }
          } else {
            itemObs.push(of({
              name: item.name,
              order: item.order,
              children: [],
            }));
          }
        });

        if (itemObs.length) {
          return forkJoin(itemObs);
        }

        return of(
          items.map((item: any) => ({
            name: item.name,
            order: item.order,
            children: [],
          })),
        );
      }),
      map(items => items.sort((a: any, b: any) => a.order - b.order)),
    );
  }
}

import { Injectable } from '@angular/core';
import { CvService } from '@cv/cv.service';
import { CvFlatNode } from '@cv/interfaces/cv-flat-node';
import { Action, Selector, State, StateContext, Store } from '@ngxs/store';
import { PreloaderVisibility } from '@store/ui/ui.action';
import { finalize, tap } from 'rxjs/operators';

import { GetItems as GetItems } from './cv.actions';

export interface CvStateModel {
    items: CvFlatNode[] | null;
}

@State<CvStateModel>({
    name: 'cv',
    defaults: {
        items: null,
    },
})
@Injectable()
export class CvState {
    constructor(
        private cvService: CvService,
        private store: Store,
    ) {
    }

    @Selector()
    public static getItems(state: CvStateModel) {
        return state.items;
    }

    @Action(GetItems)
    getItems({ patchState, getState }: StateContext<CvStateModel>) {
        const state = getState();

        if (state && state.items) {
            return;
        }

        this.store.dispatch(new PreloaderVisibility(true));

        return this.cvService.getCv().pipe(
            tap(cv => {
                patchState({
                    items: cv,
                });
            }),
            finalize(() => {
                this.store.dispatch(new PreloaderVisibility(false));
            }),
        );
    }

}

import { FlatTreeControl } from '@angular/cdk/tree';
import { ChangeDetectionStrategy, Component, OnDestroy, OnInit, ViewEncapsulation } from '@angular/core';
import { MatTreeFlatDataSource, MatTreeFlattener } from '@angular/material/tree';
import { SeoService } from '@core/services/seo.service';
import { GetItems } from '@cv/store/cv.actions';
import { CvState } from '@cv/store/cv.state';
import { Store } from '@ngxs/store';
import { Subject } from 'rxjs';
import { takeUntil } from 'rxjs/operators';

import { CvFlatNode } from './interfaces/cv-flat-node';
import { CvNodeDetail } from './interfaces/cv-node-detail';

@Component({
  selector: 'app-cv',
  templateUrl: './cv.component.html',
  styleUrls: ['./cv.component.scss'],
  encapsulation: ViewEncapsulation.None,
  changeDetection: ChangeDetectionStrategy.OnPush,
})
export class CvComponent implements OnInit, OnDestroy {
  treeControl = new FlatTreeControl<CvFlatNode>(node => node.level, node => node.expandable);
  treeFlattener = new MatTreeFlattener((node: CvNodeDetail, level: number) => ({
    expandable: !!node.children && node.children.length > 0,
    name: node.name,
    level,
    route: node.route || '',
  }), node => node.level, node => node.expandable, node => node.children);
  dataSource = new MatTreeFlatDataSource(this.treeControl, this.treeFlattener);

  private $unsubsriber = new Subject<any>();

  constructor(
    private store: Store,
    private seo: SeoService,
  ) {
  }

  hasChild = (_: number, node: CvFlatNode) => node.expandable;

  ngOnInit() {
    this.seo.generateTags({
      title: 'MJ Datario | CV',
      description: 'Curriculum Vitae',
      image: '/assets/images/placeholder.jpg',
      slug: 'cv',
    });

    this.store.select(CvState.getItems).pipe(
      takeUntil(this.$unsubsriber),
    ).subscribe((cv) => {
      if (cv) {
        this.dataSource.data = cv;
        this.treeControl.expandAll();
      }
    });
    this.store.dispatch(new GetItems());
  }

  ngOnDestroy() {
    this.$unsubsriber.next();
    this.$unsubsriber.complete();
  }

  toggleNode(node: CvFlatNode): void {
    if (this.treeControl.isExpanded(node)) {
      this.treeControl.collapse(node);

      return;
    }

    this.treeControl.expand(node);
  }
}

